import React, {Component} from "react";
import Tilt from 'react-parallax-tilt';

const Logo = () => {
    return (
        <div className="ma4 mt0">
            <Tilt className=" br2 shadow-6">
                <div style={{height: 50, width: 40}}>
                    <h1> HI</h1>
                </div>
            </Tilt>

        </div>
    )
}

export default Logo;
